INSERT INTO `guiforms_label` VALUES (NULL,2,0,'2. Krankenkassendaten',0,5),(NULL,2,0,'1. Patientendaten',0,7),(NULL,2,0,'Z1. Nutzung im Rahmen von NUM-CODEX',0,10),(NULL,2,0,'MI-I Broad Consent',0,17),(NULL,2,0,'4. Erneute Kontaktaufnahme',0,25),(NULL,2,0,'3. Biomaterialien',0,31),(NULL,2,0,'Einwilligungserklärung',0,33),(NULL,2,0,'Covid-19 Aufnahme',0,37),(NULL,2,0,'Interventionelle Studienteilnahme',0,41),(NULL,2,0,'Aufnahmedatum',0,46),(NULL,2,0,'Erkrankungsphase zum Zeitpunkt der Diagnose',0,51),(NULL,0,0,'<div class=\"rich-text-field-label\"><p><strong>Uncomplicated Phase (Phase ohne Komplikationen)<br /></strong></p> <ul> <li><span lang=\"EN-US\" style=\"font-weight: normal;\">asymtomatic</span></li> </ul> <p style=\"margin: 0cm;\">    <span lang=\"EN-US\">OR</span></p> <ul> <li><span style=\"font-weight: normal;\"><span lang=\"EN-US\">symptoms of upper respiratory tract infection</span>      </span></li> <li><span style=\"font-weight: normal;\">nausea, emesis, diarrhea</span></li> <li><span style=\"font-weight: normal;\">fever</span></li> </ul> <p style=\"margin: 0cm;\"><strong>Complicated Phase</strong><strong> (Phase mit Komplikationen)</strong></p> <div> <ul> <li><span style=\"font-weight: normal;\">need for new oxygen supplementation</span></li> <li><span style=\"font-weight: normal;\"><span lang=\"EN-US\">clinically meaningful increase of prior oxygen home therapy</span>                 </span></li> <li><span style=\"font-weight: normal;\">PaO2 at room air < 70 mmHg</span></li> <li><span style=\"font-weight: normal;\">SO2 at room air < 90 %</span></li> <li><span style=\"font-weight: normal;\">AST or ALT > 5x ULN</span></li> <li><span style=\"font-weight: normal;\">new cardiac arrhythmia</span></li> <li><span style=\"font-weight: normal;\">new pericardial effusion > 1 cm</span></li> <li><span style=\"font-weight: normal;\">new heart failure with pulmonary edema, congestive hepatopathy or peripheral edema</span></li> </ul> <div><span style=\"white-space: p